import {
  HeaderWrapper,
//   HeaderLogo,
  HeaderLogoWrapper,
  HeaderLogoButton,
  HeaderText,
} from "./styles";

const Header = () => {
  return (

    <>
     <HeaderWrapper>
      <HeaderLogoWrapper>
         <HeaderLogoButton>
           {/* <HeaderLogo src="" alt="logo" /> */}
           <HeaderText>Movies App</HeaderText>
      </HeaderLogoButton>
      </HeaderLogoWrapper>
     </HeaderWrapper>
    </>
  );
};

export default Header;
